  const ends = getEnds(神奈川県横浜市戸塚区['polygons']);

  // Shape size on actual coordinate(before scaling)
  const shapeWidth = Math.abs(ends.w - ends.e);
  const shapeHeight = Math.abs(ends.s - ends.n);

  const SquareSize = 360;

